import { Container, Row, Col } from "react-bootstrap";

const Form = (props) => {
  return (
    <div className="gray-box forms">
      <Container>
        <Row>
          <Col xs={12}>
            <form>
              <Row>
                <Col xs={12}>
                  <hr className="form-title-separator" />
                  <h1>{props.title}</h1>
                  <hr className="form-title-separator" />
                </Col>
              </Row>
            </form>
          </Col>
        </Row>
      </Container>
    </div>
  );
};

export default Form;
